import React from 'react';
//import { Container } from 'react-bootstrap';
//import {Link} from 'react-router-dom';
//import './styles.css'
import 'bootstrap/dist/css/bootstrap.min.css';
//import Navbar from 'react-bootstrap/Navbar';
//import Nav from 'react-bootstrap/Nav';

import  youtube from "../images/youtube-logo.svg";
import  instagram from '../images/instagram-logo.svg';
import  twitter from '../images/twitter-logo.svg';
import  facebook from '../images/facebook-logo.svg';

function Rodape() {
  
  return (
    <div className="App">
    <footer className="rodape">  
        <ul className='redes'>
      <a href={"https://youtube.com"} target={"_"}>
    <img src={youtube} alt="ícone youtube" class="icone" />
  </a>
      <a href={"https://instagram.com"} target={""}>
      <img src={instagram} alt="ícone instagram" class="icone" />
  </a>
      <a href={"https://twitter.com"} target={""}>
      <img src={twitter} alt="ícone twitter" class="icone" />
  </a>
      <a href={"https://facebook.com"} target={""}>
      <img src={facebook} alt="ícone facebook" class="icone" />
  </a>
</ul>
<ul className="whats">
  <a href={"https://web.whatsapp.com"} target={""} >
      <img src={"https://upload.wikimedia.org/wikipedia/commons/thumb/6/6b/WhatsApp.svg/2044px-WhatsApp.svg.png"} alt="ícone whats" class="icone" />
  </a>
</ul>
    </footer>            
</div>         
);
        
}

export default Rodape;
